import React, { Children } from 'react'
const onClick =(ev,id,value)=>{
    alert("On click" + id)
}
const GameCircle = ({id,value,children}) => {

  return (
    <div style={{backgroundColor:color}} onClick={(ev)=>onClick(ev,id,value)}>
      {children}
    </div>
  )
}

export default GameCircle
